INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(1, 'The Godfather', 'Fancis Ford Coppola', 'América, años 40. Don Vito Corleone (Marlon Brando) es el respetado y temido jefe de una de las cinco familias de la mafia de Nueva York. Tiene cuatro hijos: Connie (Talia Shire), el impulsivo Sonny (James Caan), el pusilánime Fredo (John Cazale) y Michael (Al Pacino), que no quiere saber nada de los negocios de su padre. Cuando Corleone, en contra de los consejos de \'Il consigliere\' Tom Hagen (Robert Duvall), se niega a participar en el negocio de las drogas, el jefe de otra banda ordena su asesinato. Empieza entonces una violenta y cruenta guerra entre las familias mafiosas.', , 'Mafia');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(2, 'The Godfather Part II', 'Francis Ford Coppola', 'Continuación de la historia de los Corleone por medio de dos historias paralelas: la elección de Michael como jefe de los negocios familiares y los orígenes del patriarca, Don Vito Corleone, primero en su Sicilia natal y posteriormente en Estados Unidos, donde, empezando desde abajo, llegó a ser un poderosísimo jefe de la mafia de Nueva York.', , 'Mafia');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(3, '12 Angry Men', 'Sidney Lumet', 'Los doce miembros de un jurado deben juzgar a un adolescente acusado de haber matado a su padre. Todos menos uno están convencidos de la culpabilidad del acusado. El que disiente intenta con sus razonamientos introducir en el debate una duda razonable que haga recapacitar a sus compañeros para que cambien el sentido de su voto. ', , 'Drama');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(4, 'Schindler\'s List\r\n', 'Steven Spielberg', 'Oskar Schindler (Liam Neeson), un empresario alemán de gran talento para las relaciones públicas, busca ganarse la simpatía de los nazis de cara a su beneficio personal. Después de la invasión de Polonia por los alemanes en 1939, Schindler consigue, gracias a sus relaciones con los altos jerarcas nazis, la propiedad de una fábrica de Cracovia. Allí emplea a cientos de operarios judíos, cuya explotación le hace prosperar rápidamente, gracias sobre todo a su gerente Itzhak Stern (Ben Kingsley), también judío. Pero conforme la guerra avanza, Schindler y Stern comienzan ser conscientes de que a los judíos que contratan, los salvan de una muerte casi segura en el temible campo de concentración de Plaszow, que lidera el Comandante nazi Amon Goeth (Ralph Fiennes), un hombre cruel que disfruta ejecutando judíos.', , 'Guerra');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(5, 'Witness for the Prosecution\r\n', 'Billy Wilder', 'Leonard Vole (Tyrone Power), un hombre joven y atractivo, es acusado del asesinato de la señora French, una rica anciana con quien mantenía una relacion de carácter amistoso. El presunto móvil del crimen era la posibilidad de heredar los bienes de la difunta. A pesar de que las pruebas en su contra son demoledoras, Sir Wilfrid Roberts (Charles Laughton), un prestigioso abogado criminalista londinense, se hace cargo de su defensa. ', , 'Drama');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(6, 'City Lights\r\n', 'Charles Chaplin', 'Un pobre vagabundo (Charles Chaplin) pasa mil y un avatares para conseguir dinero y ayudar a una pobre chica ciega (Virginia Cherrill) de la que se ha enamorado. ', , 'Comedia');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(7, 'The Shawshank Redemption\r\n', 'Frank Darabont', 'Acusado del asesinato de su mujer, Andrew Dufresne (Tim Robbins), tras ser condenado a cadena perpetua, es enviado a la cárcel de Shawshank. Con el paso de los años conseguirá ganarse la confianza del director del centro y el respeto de sus compañeros de prisión, especialmente de Red (Morgan Freeman), el jefe de la mafia de los sobornos. ', , 'Drama');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(8, 'The Great Dictator\r\n', 'Charles Chaplin', 'Un humilde barbero judío que combatió con el ejército de Tomania en la Primera Guerra Mundial vuelve a su casa años después del fin del conflicto. Amnésico a causa de un accidente de avión, no recuerda prácticamente nada de su vida pasada, y no conoce la situación política actual del país: Adenoid Hynkel, un dictador fascista y racista, ha llegado al poder y ha iniciado la persecución del pueblo judío, a quien considera responsable de la situación de crisis que vive el país. Paralelamente, Hynkel y sus colaboradores han empezado a preparar una ofensiva militar destinada a la conquista de todo el mundo.', , 'Comedia');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(9, 'Pulp Fiction\r\n', 'Quentin Tarantino', 'Jules y Vincent, dos asesinos a sueldo con no demasiadas luces, trabajan para el gángster Marsellus Wallace. Vincent le confiesa a Jules que Marsellus le ha pedido que cuide de Mia, su atractiva mujer. Jules le recomienda prudencia porque es muy peligroso sobrepasarse con la novia del jefe. Cuando llega la hora de trabajar, ambos deben ponerse \"manos a la obra\". Su misión: recuperar un misterioso maletín.', , 'Thriller');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(10, 'Modern Times\r\n', 'Charles Chaplin', 'Extenuado por el frenético ritmo de la cadena de montaje, un obrero metalúrgico acaba perdiendo la razón. Después de recuperarse en un hospital, sale y es encarcelado por participar en una manifestación en la que se encontraba por casualidad. En la cárcel, también sin pretenderlo, ayuda a controlar un motín, gracias a lo cual queda en libertad. Una vez fuera, reemprende la lucha por la supervivencia en compañía de una joven huérfana a la que conoce en la calle.', , 'Comedia');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(11, 'The Sting\r\n', 'George Roy Hill', 'Chicago, años treinta. Johnny Hooker (Redford) y Henry Gondorff (Newman) son dos timadores que deciden vengar la muerte de un viejo y querido colega, asesinado por orden de un poderoso gángster llamado Doyle Lonnegan (Shaw). Para ello urdirán un ingenioso y complicado plan con la ayuda de todos sus amigos y conocidos.', , 'Intriga');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(12, 'Seppuku (Harakiri)\r\n', 'Masaki Kobayashi', 'Un samurái pide permiso para practicarse el Seppuku (o Harakiri), ceremonia durante la cual se quitará la vida abriéndose el estómago al tiempo que otro samurái lo decapitará. Solicita también poder contar la historia que le ha llevado a tomar tan trágica decisión.', , 'Drama');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(13, 'To Be or Not to Be\r\n', 'Ernst Lubitsch', 'Segunda Guerra Mundial (1939-1945). Varsovia, durante la ocupación alemana. El profesor Siletsky, un espía al servicio de la Gestapo, está a punto de entregar una lista con el nombre de los colaboradores de la Resistencia. Joseph Tura, actor polaco, intérprete de Hamlet y esposo de María Tura, también conocida actriz, intentará evitarlo. Con la ayuda de los actores de su compañía, se hará pasar por el cruel coronel Erhardt y por Siletsky para entrar en el cuartel general de las SS. ', , 'Comedia');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(14, 'Sunset Blvd. (Sunset Boulevard)\r\n', 'Sunset Blvd. (Sunset Boulevard)\r\n', 'Joe Gillis es un joven escritor de segunda fila que, acosado por sus acreedores, se refugia casualmente en la mansión de Norma Desmond, antigua estrella del cine mudo, que vive fuera de la realidad, acompañada únicamente de su fiel criado Max. A partir de ese momento, la actriz pretende que Joe corrija un guion que ella ha escrito y que va a significar su regreso al cine. ', , 'Cine negro');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(15, 'La vita è bella\r\n', 'Roberto Benigni', 'En 1939, a punto de estallar la Segunda Guerra Mundial (1939-1945), el extravagante Guido llega a Arezzo, en la Toscana, con la intención de abrir una librería. Allí conoce a la encantadora Dora y, a pesar de que es la prometida del fascista Rodolfo, se casa con ella y tiene un hijo. Al estallar la guerra, los tres son internados en un campo de exterminio, donde Guido hará lo imposible para hacer creer a su hijo que la terrible situación que están padeciendo es tan sólo un juego. ', , 'Guerra');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(16, 'All About Eve\r\n', 'Joseph L. Mankiewicz', 'La joven Eva (Anne Baxter), que aspira a convertirse en actriz y triunfar en los escenarios, se las ingenia para introducirse en un grupo de actores de teatro y hacerse amiga y confidente de la famosa y veterana actriz Margo Channing (Bette Davis), gran dama de la escena neoyorquina. El deseo de actuar y los celos la consumen hasta el punto de comenzar a traicionar a sus compañeros en su escalada hacia el éxito. Ella halaga, atrae, seduce, pero también pisotea a todo el que se cruza en su camino: escritores, directores, productores. Sólo un inteligente crítico teatral comienza a adivinar lo que se esconde tras su dulce apariencia, sólo él es capaz de ver a \"Eva al desnudo\"', , 'Teatro');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(17, 'Paths of Glory\r\n', 'Stanley Kubrick', 'Primera Guerra Mundial (1914-1918). En 1916, en Francia, el general Boulard ordena la conquista de una inexpugnable posición alemana y encarga esa misión al ambicioso general Mireau. El encargado de dirigir el ataque será el coronel Dax. La toma de la colina resulta un infierno, y el regimiento emprende la retirada hacia las trincheras. El alto mando militar, irritado por la derrota, decide imponer al regimiento un terrible castigo que sirva de ejemplo a los demás soldados. ', , 'Guerra');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(18, 'Tengoku to Jigokuaka', 'Akira Kurosawa', 'En un momento crucial de su vida financiera, Gondo (Toshirô Mifune), un directivo de una importante empresa de zapatos, recibe la noticia de que su hijo ha sido secuestrado. El rescate exigido es una gran cantidad de dinero, pero Gondo la necesita para cerrar una negociación que le dará el control de la empresa.', , 'Cine negro');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(19, 'Sunrise: A Song of Two Humans\r\n', 'F.W. Murnau', 'Un granjero (George O\'Brien) convive felizmente en el campo con su esposa (Janet Gaynor). Pero la aparición de una seductora mujer (Margaret Livingston) de la ciudad hace que comience a enamorarse de ésta, y a pensar que su mujer es un estorbo que se interpone en la felicidad entre él y su nueva y sofisticada amante. ', , 'Romance');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(20, 'Double Indemnity\r\n', 'Billy Wilder', 'En la ciudad de Los Angeles un agente de una compañía de seguros (Fred MacMurray) y una cliente (Bárbara Stanwyck) traman asesinar al marido de esta última para así cobrar un cuantioso y falso seguro de accidentes. Todo se complica cuando entra en acción Barton Keyes (Edward G. Robinson), investigador de la empresa de seguros. ', , 'Cine negro');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(21, 'Shichinin no Samurai (Seven Samurai)\r\n', 'Akira Kurosawa', 'Japón, Siglo XVI. Una aldea de campesinos indefensos es repetidamente atacada y saqueada por una banda de forajidos. Aconsejados por el anciano de la aldea, unos aldeanos acuden a la ciudad con el objetivo de contratar a un grupo de samuráis para protegerlos. A pesar de que el único salario es comida y techo, varios samuráis se van incorporando uno a uno al singular grupo que finalmente se dirige a la aldea. ', , 'Aventuras');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(22, 'The Apartment\r\n', 'Billy Wilder', 'C.C. Baxter (Jack Lemmon) es un modesto pero ambicioso empleado de una compañía de seguros de Manhattan. Está soltero y vive solo en un discreto apartamento que presta ocasionalmente a sus superiores para sus citas amorosas. Tiene la esperanza de que estos favores le sirvan para mejorar su posición en la empresa. Pero la situación cambia cuando se enamora de una ascensorista (Shirley MacLaine) que resulta ser la amante de uno de los jefes que usan su apartamento (Fred MacMurray). ', , 'Comedia');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(23, 'Cidade de Deus\r\n', 'Fernando Meirelles, Kátia Lund', 'Basada en hechos reales, describe el mundo del crimen organizado en Cidade de Deus, un suburbio de Río de Janeiro, desde finales de los sesenta hasta principios de los ochenta, época durante la cual el tráfico de drogas y la violencia impusieron su ley en las favelas. A finales de los sesenta, Buscapé, un niño de 11 años tímido y sensible, observa a los niños duros de su barrio, sus robos, sus peleas, sus enfrentamientos diarios con la policía. Pero él sabe muy bien lo que quiere ser si consigue sobrevivir: fotógrafo. Dadinho, un niño de su edad que se traslada al barrio, sueña con ser el criminal más peligroso de Río de Janeiro y empieza su aprendizaje haciendo recados para los delincuentes locales. Admira a Cabeleira y su pandilla, que se dedican a atracar los camiones del gas. Un día Cabeleira le da a Dadinho la oportunidad de cometer su primer asesinato.', , 'Drama');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(24, 'The Kid', 'Charles Chaplin', 'Una mujer de escasos recursos (Edna Purviance), ha tenido un hijo siendo soltera, y al sentirse abandonada por el padre del niño, decide también ella abandonar al bebé, con la esperanza de que una familia rica lo coja en adopción. Pero el pequeño terminará en manos de un vagabundo (Charles Chaplin), quien pronto se encariñará con él y decidirá sacarlo adelante como sea. Cuando el niño, llamado ahora John (Jackie Coogan) llega a los cinco años, la lucha por la supervivencia y por permanecer juntos será toda una aventura.', , 'Comedia');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(25, 'Le trou\r\n', 'Jacques Becker', 'Manu, Roland, Jo y Vosselin comparten celda en la prisión francesa de La Santé. Los cuatro han pensado un elaborado método para escapar de la prisión, pero cuando están a punto de ejecutarlo, les asignan un nuevo compañero de celda, al que no saben si comunicarle o no sus planes. ', , 'Drama');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(26, 'The Gold Rush\r\n', 'Charles Chaplin', 'Obra maestra de Chaplin, en la que interpreta a un solitario buscador de oro que llega a Alaska, a principios de siglo, en busca de fortuna. Una fuerte tormenta de nieve le llevará a refugiarse en la cabaña de un bandido. En 1942 fue reestrenada en versión sonora. ', , 'Comedia');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(27, 'Goodfellas', 'Martin Scorsese', 'Henry Hill, hijo de padre irlandés y madre siciliana, vive en Brooklyn y se siente fascinado por la vida que llevan los gángsters de su barrio, donde la mayoría de los vecinos son inmigrantes. Paul Cicero, el patriarca de la familia Pauline, es el protector del barrio. A los trece años, Henry decide abandonar la escuela y entrar a formar parte de la organización mafiosa como chico de los recados; muy pronto se gana la confianza de sus jefes, gracias a lo cual irá subiendo de categoría. ', , 'Thriller');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(28, 'Psycho', 'Alfred Hitchcock', 'Marion Crane, una joven secretaria, tras cometer el robo de un dinero en su empresa, huye de la ciudad y, después de conducir durante horas, decide descansar en un pequeño y apartado motel de carretera regentado por un tímido joven, Norman Bates, que vive en la casa de al lado con su madre.', , 'Terror');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(29, 'Casablanca\r\n', 'Michael Curtiz', 'Años 40. A consecuencia de la Segunda Guerra Mundial, Casablanca era una ciudad a la que llegaban huyendo del nazismo gente de todas partes: llegar era fácil, pero salir era casi imposible, especialmente si el nombre del fugitivo figuraba en las listas de la Gestapo, que presionaba a la autoridades francesas al mando del corrupto inspector Renault. En este caso, el objetivo de la policía secreta alemana es el líder checo y héroe de la resistencia Victor Laszlo, cuya única esperanza es Rick Blaine, propietario del \'Rick’s Café\' y antiguo amante de su mujer, Ilsa Lund. Rick e Ilsa se habían conocido en París, pero la entrada de las tropas alemanas en la capital francesa les separó.', , 'Romance');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(30, 'Akahige', 'Akira Kurosawa', 'El joven doctor Yasuoto regresa a su pueblo después de estudiar en Nagasaki, pero, en cuanto llega, sufre una gran desilusión: en lugar de ser nombrado médico del shogun lo envían a una clínica que cuenta con muy pocos recursos y está dirigida por un médico apodado \"Barbarroja\".', , 'Medicos');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(31, 'The Pianist (Le Pianiste)\r\n', 'Roman Polanski', 'Wladyslaw Szpilman, un brillante pianista polaco de origen judío, vive con su familia en el ghetto de Varsovia. Cuando, en 1939, los alemanes invaden Polonia, consigue evitar la deportación gracias a la ayuda de algunos amigos. Pero tendrá que vivir escondido y completamente aislado durante mucho tiempo, y para sobrevivir tendrá que afrontar constantes peligros.', , 'Guerra');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(32, 'Gran Torino\r\n', 'Clint Eastwood', 'Walt Kowalski (Clint Eastwood), un veterano de la guerra de Corea (1950-1953), es un obrero jubilado del sector del automóvil que ha enviudado recientemente. Su máxima pasión es cuidar de su más preciado tesoro: un coche Gran Torino de 1972. Es un hombre inflexible y cascarrabias, al que le cuesta trabajo asimilar los cambios que se producen a su alrededor, especialmente la llegada de multitud de inmigrantes asiáticos a su barrio. Sin embargo, las circustancias harán que se vea obligado a replantearse sus ideas.', , 'Drama');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(33, 'The Lord of the Rings: The Return of the King\r\n', 'Peter Jackson', '\r\nLas fuerzas de Saruman han sido destruidas, y su fortaleza sitiada. Ha llegado el momento de decidir el destino de la Tierra Media, y, por primera vez, parece que hay una pequeña esperanza. El interés del señor oscuro Sauron se centra ahora en Gondor, el último reducto de los hombres, cuyo trono será reclamado por Aragorn. Sauron se dispone a lanzar un ataque decisivo contra Gondor. Mientras tanto, Frodo y Sam continuan su camino hacia Mordor, con la esperanza de llegar al Monte del Destino. ', , 'Fantasia');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(34, 'The Dark Knight\r\n', 'Christopher Nolan', 'Batman/Bruce Wayne (Christian Bale) regresa para continuar su guerra contra el crimen. Con la ayuda del teniente Jim Gordon (Gary Oldman) y del Fiscal del Distrito Harvey Dent (Aaron Eckhart), Batman se propone destruir el crimen organizado en la ciudad de Gotham. El triunvirato demuestra su eficacia, pero, de repente, aparece Joker (Heath Ledger), un nuevo criminal que desencadena el caos y tiene aterrados a los ciudadanos.', , 'Superheroes');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(35, 'El secreto de sus ojos\r\n', 'Juan José Campanella', '\r\nBenjamín Espósito es oficial de un Juzgado de Instrucción de Buenos Aires recién retirado. Obsesionado por un brutal asesinato ocurrido veinticinco años antes, en 1974, decide escribir una novela sobre el caso, del cual fue testigo y protagonista. Reviviendo el pasado, viene también a su memoria el recuerdo de una mujer, a quien ha amado en silencio durante todos esos años.', , 'Thriller');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(36, 'Sen to Chihiro no kamikakushiaka ', 'Hayao Miyazaki', 'Chihiro es una niña de diez años que viaja en coche con sus padres. Después de atravesar un túnel, llegan a un mundo fantástico, en el que no hay lugar para los seres humanos, sólo para los dioses de primera y segunda clase. Cuando descubre que sus padres han sido convertidos en cerdos, Chihiro se siente muy sola y asustada.', , 'Animacion');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(37, 'Mary and Max\r\n', 'Adam Elliot', 'Primer largometraje de Adam Elliot, ganador de un Oscar con el cortometraje \"Harvey Krumpet\". Narra la larga amistad por correspondencia entre un cuarentón judío y obeso de Nueva York, y una niña australiana de ocho años que vive en los suburbios de Melbourne.', , 'Animacion');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(38, 'Das Leben der Anderen', 'Florian Henckel von Donnersmarck', 'República Democrática Alemana, año 1984. El capitán Gerd Wiesler (Ulrich Mühe), un hombre solitario, es un competente oficial del servicio de inteligencia y espionaje de la Stasi, la todopoderosa policía secreta del régimen comunista de la RDA. Sin embargo, cuando le encomiendan que espíe a la pareja formada por un prestigioso escritor (Sebastian Koch) y una popular actriz (Martina Gedenk), no puede ni siquiera imaginar hasta qué punto esa misión va a influir en su concepción de la vida y del mundo.', , 'Thriller');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(39, 'Intouchables', 'Oliver Nakache, Eric Toledano', 'Philippe, un aristócrata millonario que se ha quedado tetrapléjico a causa de un accidente de parapente, contrata como cuidador a domicilio a Driss, un inmigrante de un barrio marginal recién salido de la cárcel. Aunque, a primera vista, no parece la persona más indicada, los dos acaban logrando que convivan Vivaldi y Earth Wind and Fire, la elocuencia y la hilaridad, los trajes de etiqueta y el chándal. Dos mundos enfrentados que, poco a poco, congenian hasta forjar una amistad tan disparatada, divertida y sólida como inesperada, una relación única en su especie de la que saltan chispas.', , 'Comedia');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(40, 'Million Dollar Baby\r\n', 'Clint Eastwood', 'Después de haber entrenado y representado a los mejores púgiles, Frankie Dunn (Eastwood) regenta un gimnasio con la ayuda de Scrap (Freeman), un ex-boxeador que es además su único amigo. Frankie es un hombre solitario y adusto que se refugia desde hace años en la religión buscando una redención que no llega. Un día, entra en su gimnasio Maggie Fitzgerald (Swank), una voluntariosa chica que quiere boxear y que está dispuesta a luchar denodadamente para conseguirlo. Frankie la rechaza alegando que él no entrena chicas y que, además, es demasiado mayor. Pero Maggie no se rinde y se machaca cada día en el gimnasio, con el único apoyo de Scrap. ', , 'Drama');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(41, 'The Lord of the Rings: The Fellowship of the Ring\r\n', 'Peter Jackson', 'En la Tierra Media, el Señor Oscuro Sauron ordenó a los Elfos que forjaran los Grandes Anillos de Poder. Tres para los reyes Elfos, siete para los Señores Enanos, y nueve para los Hombres Mortales. Pero Saurón también forjó, en secreto, el Anillo Único, que tiene el poder de esclavizar toda la Tierra Media. Con la ayuda de sus amigos y de valientes aliados, el joven hobbit Frodo emprende un peligroso viaje con la misión de destruir el Anillo Único. Pero el malvado Sauron ordena la persecución del grupo, compuesto por Frodo y sus leales amigos hobbits, un mago, un hombre, un elfo y un enano. La misión es casi suicida pero necesaria, pues si Sauron con su ejército de orcos lograra recuperar el Anillo, sería el final de la Tierra Media.', , 'Fantasia');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(42, 'Coco', 'Lee Unkrich, Adrián Molina', 'Miguel es un joven con el sueño de convertirse en leyenda de la música a pesar de la prohibición de su familia. Su pasión le llevará a adentrarse en la \"Tierra de los Muertos\" para conocer su verdadero legado familiar. ', , 'Animacion');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(43, 'Joker', 'Todd Phillips', 'Arthur Fleck (Phoenix) vive en Gotham con su madre, y su única motivación en la vida es hacer reír a la gente. Actúa haciendo de payaso en pequeños trabajos, pero tiene problemas mentales que hacen que la gente le vea como un bicho raro. Su gran sueño es actuar como cómico delante del público, pero una serie de trágicos acontecimientos le hará ir incrementando su ira contra una sociedad que le ignora.', , 'Thriller');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(44, 'Inception', 'Christopher Nolan', 'Dom Cobb (DiCaprio) es un experto en el arte de apropiarse, durante el sueño, de los secretos del subconsciente ajeno. La extraña habilidad de Cobb le ha convertido en un hombre muy cotizado en el mundo del espionaje, pero también lo ha condenado a ser un fugitivo y, por consiguiente, a renunciar a llevar una vida normal. Su única oportunidad para cambiar de vida será hacer exactamente lo contrario de lo que ha hecho siempre: la incepción, que consiste en implantar una idea en el subconsciente en lugar de sustraerla. Sin embargo, su plan se complica debido a la intervención de alguien que parece predecir cada uno de sus movimientos, alguien a quien sólo Cobb podrá descubrir. ', , 'Ciencia ficcion');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(45, 'The Lord of the Rings: The Two Towers\r\n', 'Peter Jackson', 'Tras la disolución de la Compañía del Anillo, Frodo y su fiel amigo Sam se dirigen hacia Mordor para destruir el Anillo Único y acabar con el poder de Sauron, pero les sigue un siniestro personaje llamado Gollum. Mientras, y tras la dura batalla contra los orcos donde cayó Boromir, el hombre Aragorn, el elfo Legolas y el enano Gimli intentan rescatar a los medianos Merry y Pipin, secuestrados por los orcos de Mordor. Por su parte, Saurón y el traidor Sarumán continúan con sus planes en Mordor, a la espera de la guerra contra las razas libres de la Tierra Media.', , 'Fantasia');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(46, 'Gisaengchungaka ', 'Bong Joon-ho', 'Tanto Gi Taek (Song Kang-ho) como su familia están sin trabajo. Cuando su hijo mayor, Gi Woo (Choi Woo-sik), empieza a dar clases particulares en casa de Park (Lee Seon-gyun), las dos familias, que tienen mucho en común pese a pertenecer a dos mundos totalmente distintos, comienzan una interrelación de resultados imprevisibles', , 'Intriga');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(47, 'Toy Story 3\r\n', 'Lee Unkrich', 'Cuando su dueño Andy se prepara para ir a la universidad, el vaquero Woody, el astronauta Buzz y el resto de sus amigos juguetes comienzan a preocuparse por su incierto futuro. Efectivamente todos acaban en una guardería, donde por ejemplo la muñeca Barbie conocerá al guapo Ken. Esta reunión de nuestros amigos con otros nuevos juguetes no será sino el principio de una serie de trepidantes y divertidas aventuras.', , 'Animacion');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(48, 'Gladiatoraka', 'Ridley Scott', 'En el año 180, el Imperio Romano domina todo el mundo conocido. Tras una gran victoria sobre los bárbaros del norte, el anciano emperador Marco Aurelio (Richard Harris) decide transferir el poder a Máximo (Russell Crowe), bravo general de sus ejércitos y hombre de inquebrantable lealtad al imperio. Pero su hijo Cómodo (Joaquin Phoenix), que aspiraba al trono, no lo acepta y trata de asesinar a Máximo.', , 'Accion');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(49, 'WALL-E\r\n', 'Andrew Stanton', 'En el año 2800, en un planeta Tierra devastado y sin vida, tras cientos de solitarios años haciendo aquello para lo que fue construido -limpiar el planeta de basura- el pequeño robot WALL•E (acrónimo de Waste Allocation Load Lifter Earth-Class) descubre una nueva misión en su vida (además de recolectar cosas inservibles) cuando se encuentra con una moderna y lustrosa robot exploradora llamada EVE. Ambos viajarán a lo largo de la galaxia y vivirán una emocionante e inolvidable aventura... ', , 'Animacion');
INSERT INTO `peliculas` (`idpelicula`, `titulo`, `director`, `descripcion`, `imagen`, `categoria`) VALUES
(50, 'Big Fish\r\n', 'Tim Burton', 'William Bloom (Billy Crudup) no tiene muy buena relación con su padre (Albert Finney), pero tras enterarse de que padece una enfermedad terminal, regresa a su hogar para estar a su lado en sus últimos momentos. Una vez más, William se verá obligado a escucharlo mientras cuenta las interminables historias de su juventud. Pero, en esta ocasión, tratará de averiguar cosas que le permitan conocer mejor a su padre, aunque para ello tendrá que separar claramente realidad y fantasía, elementos que aparecen siempre mezclados en los relatos de su progenitor.', , 'Aventuras');
